import React from 'react';
    import { cn } from "../../lib/utils"

    interface AlertProps {
        variant?: "default" | "destructive";
        className?: string;
        children: React.ReactNode;
    }
    const Alert: React.FC<AlertProps> = ({ variant, className, children }) => {
        const classes = cn(
            "border p-4 rounded",
            variant === "destructive" && "bg-red-100 border-red-400 text-red-700",
            className
        );
        return <div className={classes}>{children}</div>;
    };

    const AlertTitle: React.FC<{ className?: string; children: React.ReactNode }> = ({ className, children }) => <h4 className={cn("font-bold", className)}>{children}</h4>
    const AlertDescription: React.FC<{ className?: string; children: React.ReactNode }> = ({ className, children }) => <p className={className}>{children}</p>

    export { Alert, AlertTitle, AlertDescription };
